  "description": "Olof Albrekt Behm was a dentist from Kungsbacka, Sweden. He was born on March 12, 1896 in Helsingborg to lecturer Olof Pedro B. and Märta Zetterström. He completed high school in Latin in Gothenburg in 1914, reserved officer exam in 1916, dental studies completed in 1918, and became a licensed dentist in 1920. He served as a second lieutenant in the Göta Artillery Regiment from 1916-1921 and started practicing dentistry in Kungsbacka in 1920. He also worked as a school dentist in Kungsbacka from 1920 to 1932. Behm was involved in various organizations throughout his life, including the Halland Dental Association, City Council, Fjäre Härads Savings bank, Municipal Intermediates Committee, and Poor Relief Board. He wrote articles and gave lectures on school dental issues." 
